import { makeStyles } from "@mui/styles";
import { Box, Button, Container, Divider} from "@mui/material";
import FunctionsIcon from '@mui/icons-material/Functions';
import Title from "../components/Title";

const useStyles = makeStyles({
  main: {
    display: "flex !important",
    flexDirection: "column",
    alignItems: "center",
    gap: 15,
  },
  logo: {
    maxWidth: 50,
  }
});

const MonteCarloEstimation = () => {
  const classes = useStyles();

  return (
    <Container className={classes.main} maxWidth={"xl"}>
      <Title title={"Montecarlo - Poker Simulation"} icon={<img alt="Poker Logo" src="/assets/images/poker_logo.jpeg" className={classes.logo}/>} />
      <Button>Draw cards</Button>
      <img alt="Poker Logo" src={require("../assets/images/pokerLogo.jpg")} />
    </Container>
  )
}

export default MonteCarloEstimation;
